<!--    <div class="coin-button-outside" />-->
<!--    <div class="coin-button-inside" />-->
    <transition-group v-for="(val, i) in nums">
      <span
        v-if="val.show === true"
        :ref="`num-${i}`"
        class="num"
        :style="{ top: `${val.y}px`, left: `${val.x}px` }"
